 Thanks for finding the issue. I don't like the fact that we require a `Configuration` to construct `DefaultHttpErrorHandler` even though the only thing we use from configuration is the optional `play.editor`. So it would be nice to change the constructor of `DefaultHttpErrorHandler` to accept `playEditor: Option[String]`. If we did this we could actually make the `DefaultHttpErrorHandler` object work properly:

``` scala
object DefaultHttpErrorHandler extends DefaultHttpErrorHandler(Environment.simple(), None, None, None) {
  private lazy val setEditor: Unit = {
    val conf = Configuration.load(Environment.simple())
    conf.getOptional[String]("play.editor") map setPlayEditor
  }

  override def onClientError(request: RequestHeader, statusCode: Int, message: String) = {
    setEditor
    super.onClientError(request, statusCode, message)
  }

  override def onServerError(request: RequestHeader, exception: Throwable) = {
    setEditor
    super.onServerError(request, exception)
  }
}

class DefaultHttpErrorHandler(
    environment: Environment,
    private var playEditor: Option[String],
    sourceMapper: Option[SourceMapper],
    router: => Option[Router]
) extends HttpErrorHandler {

  def this(environment: Environment, configuration: Configuration, sourceMapper: Option[SourceMapper] = None,
    router: => Option[Router] = None) =
    this(environment, configuration.getOptional[String]("play.editor"), sourceMapper, router)

  @Inject
  def this(environment: Environment, configuration: Configuration, sourceMapper: OptionalSourceMapper,
    router: Provider[Router]) =
    this(environment, configuration, sourceMapper.sourceMapper, Some(router.get))
  // ...
}
```

We can even backport this to 2.5.x fairly easily. What do you think?

