gmethvin_commented_str:
 @cchantep In the past I've simply used the language tag and encode to a JSON string. Would that be possible in this case? Also it seems like this wouldn't support languages with scripts like `zh-Hans`.

Since the language tag is a standard using that would make this default format more interoperable. If we really wanted to have a complete object representation of a locale, we need the language, country, variant and script codes. In addition, locales can define extensions, for example `de-DE-u-co-phonebk` would mean German with phonebook collation.

The extensions could be parsed out and represented as a map but I don't know if it would be particularly useful. If we don't do that, the `OWrites` representation is actually less accurate than the language tag. Is there a particular use case you're thinking of for the JSON object?

pull_request_body:
Just had this case: When validating a form I want to make sure that all integers [inside a list submitted by the user](https://www.playframework.com/documentation/2.5.x/JavaFormHelpers#Handling-repeated-values) are positiv. This can be done with Hibernate validator via:

```java
import play.data.validation.Constraints.Min;

@Valid
private List<@Min(0) Integer> values;
```

Unfortunataly all our constraints defined in [`play.data.validation.Constraints`](https://github.com/playframework/playframework/blob/2.6.0-M1/framework/src/play-java-forms/src/main/java/play/data/validation/Constraints.java) are only allowed  on fields currently. **So right now this doesn't work in Play.**
However Hibernate validator allows you to put constraints on type arguments (`TYPE_USE`) like needed in the case above. For other purposes you could put constraints on methods, constructors and other annotations as well which is all described in the hibernate validator docs.
[All](https://github.com/hibernate/hibernate-validator/tree/master/engine/src/main/java/org/hibernate/validator/constraints) the built-in Hibernate validator constraints use [these](https://github.com/hibernate/hibernate-validator/blob/master/engine/src/main/java/org/hibernate/validator/constraints/NotEmpty.java#L38) set of `@Targets` by default - I was actually wondering why Play doesn't.

## Purpose

While this API is internal and wouldnâ€™t be used by users creating application, it could be useful to people integrating with Play.

It will helps us to move from this code:

```java
public class Foo {
    public static void main(String[] args) {
        play.Environment env = play.Environment.simple();
        play.ApplicationLoader.Context context = play.ApplicationLoader.create(env);

        play.api.ApplicationLoader loader = play.api.ApplicationLoader$.MODULE$.apply(context.underlying());

        play.api.Application application = loader.load(context.underlying());
        play.core.ApplicationProvider applicationProvider = play.core.ApplicationProvider$.MODULE$.apply(application);

        scala.Option<play.api.mvc.Result> resultOption = applicationProvider.handleWebCommand(someKindOfRequestTranslation());
        
        if (resultOption.isDefined()) {
            // application was able to handle the result
            play.api.mvc.Result result = resultOption.get();
        } else {
            // no handler was found
            play.api.mvc.Result result = play.api.mvc.Results$.MODULE$.NotFound();
        }
    }

    private static play.api.mvc.RequestHeader someKindOfRequestTranslation() {
        return ...;
    }
}
```

To this new version using only Java APIs:

```java
public class Foo {
    public static void main(String[] args) {
        play.Environment env = play.Environment.simple();
        play.ApplicationLoader.Context context = play.ApplicationLoader.create(env);

        play.ApplicationLoader loader = play.ApplicationLoader.apply(context);

        play.Application application = loader.load(context);
        play.server.ApplicationProvider applicationProvider = new play.server.ApplicationProvider(application);

        play.mvc.Result result = applicationProvider
                .handleWebCommand(someKindOfRequestTranslation())
                .orElse(play.mvc.Results.notFound());
    }

    // This would translate from AWS Lambda request to a Play request.
    private static play.mvc.Http.RequestHeader someKindOfRequestTranslation() {
        return ...;
    }
}
```

## References

See discussion here: https://twitter.com/sapessi/status/859450726551924736

